// import logo from './logo.svg';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import './App.css';
import Header from './components/Header';

function App() {
  return (
    <>
    <Router>
     <Switch>
            <Header />
          <Route path="/">
          </Route>

          </Switch>
      </Router>
    </>
  );
}

export default App;
